<h1>CES 2023 – ASUS giới thiệu tay cầm Xbox tích hợp màn hình OLED</h1>
<img src="data:image/png;base64,"
     alt="">

<p class="content">Vẫn giữ nguyên thiết kế như tay cầm thế hệ trước, nhưng điểm làm nên sự khác biệt lớn nhất đó chính
    là Asus đã tích hợp màn hình OLED 1,3 inch trên tay cầm.

    Màn hình OLED này có độ phân giải 128 x 40, được thiết kế đặt phía trên nút Xbox, để hiện thị phần trăm pin, thay
    đổi profile trong game, các thông tin kết nối như bluetooth, microphone hoặc có thể dùng để cài đặt hình nền động
    (gif). Asus không phải là hãng đầu tiên tích hợp màn hình OLED lên tay cầm Xbox (trước đó đã có tay cầm Xbox do Duke
    phát triển, được giới thiệu lần đầu năm 2018), nhưng ROG Raikiri Pro là tay cầm Xbox đầu tiên tích hợp màn hình OLED
    đi kèm 3 kết nối: bluetooth – RF – USB-C.


    Hai nút phía trên cùng của Raikiri Pro có thể dùng để thay đổi profile của tay cầm trong lúc chơi game. Ngoài ra các
    nút điều khiển, độ nhạy của joystick, các chế độ của nút trigger và 4 nút điều hướng D-pad hình tròn đều có thể tùy
    chỉnh bằng ứng dụng Asus Armoury Crate PC. Mặt sau của tay cầm bao gồm 4 nút có thể lập trình và hai nút chức năng
    dùng để khóa trigger. Tay cầm cũng bao gồm ESS DAC được tích hợp sẵn, một đầu kết nối headphone 3,5mm và một nút tắt
    tiếng.


    Asus cũng giới thiệu Raikiri Pro là tay cầm dành cho PC và họ cũng ám chỉ là chỉ có thể kết nối tay cầm này vào Xbox
    series X/S thông qua dây USB-C, điều đó có nghĩa là một vài chức năng cao cấp chỉ có thể hoạt động trên PC.

    Hiện Asus chưa cung cấp giá bán cũng như ngày ra mắt chính thức của sản phẩm này, điều duy nhất chúng ta nắm được là
    Raikiri Pro sẽ được lên kệ vào khoảng quý 1/2023.</p>
<p class="author">Ryan</p>